```js
var express = require('express'); 
var app = express(); 

app.use('/', express.static('./')); 

app.get('*', function(request, response) { 
    response.sendFile('/index.html', {root: __dirname}); 
}); 

app.listen(8080, function() { 
    console.log('App now listening on port 8080'); 
}); 

```
